The one where we meet Hoda 😭❤️

Somehow… we got invited inside the @todayshow 😭 to meet @hodakotb. She was so lovely and kind. 

@jordan__allen_ this was the WILDEST morning but wow we did it… we found Hoda ❤️ All the mornings we were up early nursing babies and all the postpartum and maternity days where we just sat and held our babies and watched the Today Show. All the episodes of @hodaandjenna while a baby slept in our arms. Gosh, the season of having our babies is over and so is Hoda’s season at Today, but I’m so glad we made it here to meet her and bid her farewell.
